import React from "react"

export default ({open, ...props}) => (
    <div className={open ? "burger-menu open" : "burger-menu"} {...props}>
        <div className="topBar" key="b1" />
        <div className="midBar" key="b2" />
        <div className="botBar" key="b3" />
    </div>
);
